const showAll = ({ filtered }) => {
    console.log("from show all");
    return (
        <div>
        {filtered.map(p => 
            <div key = {p["name"]}>
              {p["name"]} {p["number"]}
            </div>
            )}
        </div>
    )
}
export default showAll
